import CreateProduct from "./create-product.component";
import EditStudent from "./edit-product.component";
import StudentList from "./product-list.component";

import "react-bootstrap/dist/react-bootstrap.min.js";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/" component={CreateProduct} />
          <Route path="/create-student" component={CreateProduct} />
          <Route path="/edit-student/:id" component={EditStudent} />
          <Route path="/student-list" component={StudentList} />
        </Switch>
      </Router>
    </div>
  );
}
export default App;
